import '../styles/App.css';

function App() {
  return (
    <div >
      <h1>Selecciona los ingredientes de la tortilla de patatas</h1>
      <form>
        <label htmlFor="ingredientes">Macarrones</label>
        <input type="checkbox" name='macarrones' id='macarrones'/>
        <label htmlFor="ingredientes">Patatas</label>
        <input type="checkbox" name='patatas' id='patatas'/>
      </form>
    </div>
  );
}

export default App;
